These are Son of Ultron's Digital Hi-Res re-releases, *** DOWNSAMPLED TO 8-BIT *** and compiled per narrative continuity. The series consists of 106 issues (including the &quot;Molly &amp; Poo&quot; spin-offs) in three volumes, presented here as 25 pseudo-TPBs.

NOTE ON QUALITY AND SIZE: The base format of these Empire versions is PNG rather than JPG, which means higher fidelity and heftier files. Unlike for colour comics, this is arguably rather worthwhile for Moore's black-and-white/grey-scale artwork.

However, the bulk of the original releases were encoded at full colour-depth (24-bit) throughout, which is pointlessly wasteful. Re-encoded to 8-bit, the torrent weighs in at 3 GBs instead of 5 GBs, with absolutely no (discernible) quality-loss.

